def int_to_roman(n: int) -> str:
    if not 1 <= n <= 3999:
        raise ValueError("n must be between 1 and 3999")
    val_sym = [
        (1000, 'M'), (900, 'CM'), (500, 'D'), (400, 'CD'),
        (100, 'C'), (90, 'XC'), (50, 'L'), (40, 'XL'),
        (10, 'X'), (9, 'IX'), (5, 'V'), (4, 'IV'), (1, 'I')
    ]
    res = []
    for val, sym in val_sym:
        while n >= val:
            res.append(sym)
            n -= val
    return ''.join(res)

# Self-review:
# Complexity: O(1) due to fixed-size val_sym and bounded loops.
# Edge cases: Handles min (1), max
